package leetcode.Strings;

import java.util.HashMap;
import java.util.Map;

public class ValidAnagram {

    public static void main(String[] args) {
        String s = "";
        String t = "";
        
        boolean result = findValidAnagram(s,t);
        System.out.print("result is : "+ result);
    }

    private static boolean findValidAnagram(String s, String t) {

        boolean flag= true;
        HashMap<Character, Long> hm1 = new HashMap<>();
        HashMap<Character, Long> hm2 = new HashMap<>();
        for(int i=0;i<s.length();i++)
        {
            if(hm1.containsKey(s.charAt(i)))
            {
                hm1.put(s.charAt(i), hm1.get(s.charAt(i))+1);
            }
            else {
                hm1.put(s.charAt(i),(long)1);
            }
        }
        for(int i=0;i<t.length();i++)
        {
            if(hm2.containsKey(t.charAt(i)))
            {
                hm2.put(t.charAt(i), hm2.get(t.charAt(i))+1);
            }
            else {
                hm2.put(t.charAt(i),(long)1);
            }
        }

        if(hm1.size()!=hm2.size())
        {
            flag = false;
        }
        else {
            for(Map.Entry<Character,Long> entry: hm1.entrySet())
            {
                Character ch= entry.getKey();
                if(hm2.containsKey(ch))
                {
                    if(hm2.get(ch).longValue()!=entry.getValue().longValue()) {
                        flag = false;
                        break;
                    }
                }
                else {
                    flag = false;
                    break;
                }
            }
        }
        return flag;
    }
}
